webpackJsonp([68443640273622],{1037:function(t,a){t.exports={data:{nodePost:{title:"Gatsby Source Drupal Filters by Published",link:null,body:{value:'<p>When initially setting up <a href="https://www.gatsbyjs.org/packages/gatsby-source-drupal/">gatsby-source-drupal</a> for this site I started thinking about how I could adjust my GraphQL query to only include published posts. I eventually realized that the plugin was already doing that by default. That isn\'t always the case for stuff like this, so it was a nice time saver.</p>\r\n\r\n<p>I also found that <a href="https://www.gatsbyjs.org/packages/gatsby-source-drupal/">gatsby-source-drupal</a> seems to work best with <a href="http://www.contentacms.org/">Contenta</a> for some reason.  More on that soon - I\'m hoping to have a longer post on Drupal and Gatsby at some point.</p>'},created:1518356069}},pathContext:{slug:"/note/gatsby-source-drupal-filters-by-published/"}}}});
